import "antd/dist/antd.css";
import NetworkDrawer from "./Components/DrawerNetwork";
import NavigationMenu from "./Components/MenuNavigation";
import DeviceManagementApp from "./DeviceManagement";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

export default function App() {
  return (
    <div>
      <NavigationMenu />
      <Routes>
        <Route path="/" exact component={NetworkDrawer} />
        <Route path="/test" exact component={DeviceManagementApp} />
      </Routes>
    </div>
  );
}
